When mongodb client should disconnect after instantiating client?<p>As per the <a href="https://github.com/mongodb/mongo-go-driver" rel="nofollow noreferrer">documentation</a> in Readme:</p>
<blockquote>
<p>Make sure to defer a call to <code>Disconnect</code> after instantiating your client:</p>
</blockquote>
<pre><code>defer func() {
    if err = client.Disconnect(ctx); err != nil {
        panic(err)
    }
}()
</code></pre>
<hr />
<p>Does the above documentation meant to disconnect, during shutdown of the program(using mongodb driver)?</p>

