Perform full search (using `$regex`) on several fields if search term is presented using aggregation<p>I have a service that displays products. I need to be able to search products by their fields (product name, barcode or sku).</p>
<p>Previously I used this approach</p>
<pre class="lang-js prettyprint-override"><code>const query: FilterQuery&lt;TProductSchema&gt; = {};

if (search) {
  query.$or = [
    {
      productName: {
        $regex: String(search).split(' ').join('|'),
        $options: 'i',
      },
    },
    {
      barcode: {
        $regex: String(search),
        $options: 'i',
      },
    },
    { sku: { $regex: String(search).split(' ').join('|'), $options: 'i' } },
  ];
}

if (folderId &amp;&amp; folderId !== 'all') {
  query.folder = { _id: folderId };
}

const products = await ProductModel.find&lt;HydratedDocument&lt;TProductSchema&gt;&gt;(query)
  .limit(Number(limit) === -1 ? 0 : Number(limit))
  .skip(Number(page) * Number(limit));
</code></pre>
<p>and it worked well but now I also need to include all documents count (which changes depending on selected <code>folderId</code>) in the resulting object.</p>
<p>I thought I could do it with the aggregation framework but I can't figure out how to conditionally match documents only if <code>search</code> is presented.</p>
<p>I thought I could do something like that</p>
<pre class="lang-js prettyprint-override"><code>const products = await ProductModel.aggregate([
  { $match: {/* match folder */ },
  { /* count matched documents */ },
  // next search documents IF `search` is present
  {
    $match: {
      $cond: [search, /* here goes `query` object, '']
    }
  },
]);
</code></pre>
<p>but it doesn't work saying <code>unknown top level operator &quot;$cond&quot;</code></p>
<p>So how can I apply <code>$match</code> conditionally?</p>

