MongoDB - using $count inside a $facet stage for the calculations<p>I have a collection and I want to get the total number of documents and use that amount in a <code>$facet</code> to calculate the 95th percentile (in the example below, the duration for each document is defined as finish_time - start_time).</p>
<p>Let's say I have these documents:</p>
<pre><code>[
  {
    &quot;_id&quot;: ObjectId(&quot;178768747638364736373637&quot;),
    &quot;start_time&quot;: ISODate(&quot;2019-02-03T12:00:00.000Z&quot;),
    &quot;finish_time&quot;: ISODate(&quot;2019-02-03T12:01:00.000Z&quot;)
  },
  {
    &quot;_id&quot;: ObjectId(&quot;266747364736363536353555&quot;),
    &quot;start_time&quot;: ISODate(&quot;2019-02-03T12:00:00.000Z&quot;),
    &quot;finish_time&quot;: ISODate(&quot;2019-02-03T12:03:00.000Z&quot;)
  },
  {
    &quot;_id&quot;: ObjectId(&quot;367463536453623546353625&quot;),
    &quot;start_time&quot;: ISODate(&quot;2019-02-03T12:00:00.000Z&quot;),
    &quot;finish_time&quot;: ISODate(&quot;2019-02-03T12:08:00.000Z&quot;)
  }
]
</code></pre>
<p>I'm expecting this output:</p>
<pre><code>[
  {
