    try {
      return await postService.getPosts();
    } catch (error) {
      const message =
        (error.response &amp;&amp;
          error.response.data &amp;&amp;
          error.response.data.message) ||
        error.message ||
        error.toString();
      return thunkAPI.rejectWithValue(message);
    }
  }
);

