Efficient transaction wrapper function with mongodb go driver<p>I'm currently integrating the transaction logic into my go+mongodb api.</p>
<p>I already created this example endpoint. It allows you to retrieve a user document and send it back to the client with json encoding.</p>
<pre class="lang-golang prettyprint-override"><code>func GetUser(w http.ResponseWriter, r *http.Request) {
    id := mux.Vars(r)[&quot;user-id&quot;]
    objectId, _ := primitive.ObjectIDFromHex(id)

    user, err := UserById(objectId)
    if err != nil {
        // ...
    }

    // do some stuff with the user, whatever

    // eventually send it back
    json.NewEncoder(w).Encode(user)
}

func UserById(id primitive.ObjectID) (models.StoredUser, error) {
    session, err := mongoClient.StartSession()
    if err != nil {
        return models.StoredUser{}, fmt.Errorf(&quot;failed starting session for transaction | %s&quot;, err.Error())
    }
    defer session.EndSession(context.TODO())

    callback := func(ctx mongo.SessionContext) (any, error) {
        res := usersCollection.FindOne(
            ctx,
            bson.M{
                &quot;_id&quot;: id,
            },
        )

        if res.Err() != nil {
            return models.StoredUser{}, fmt.Errorf(&quot;failed querying db | %s&quot;, res.Err())
        }

        return res, nil
    }

    result, err := session.WithTransaction(context.TODO(), callback)
    if err != nil {
        return models.StoredUser{}, fmt.Errorf(&quot;failed executing transaction | %s&quot;, err.Error())
    }

    asserted := result.(*mongo.SingleResult)
    var ret models.StoredUser
    if err := asserted.Decode(&amp;ret); err != nil {
        return models.StoredUser{}, fmt.Errorf(&quot;failed parsing user data in struct | %s&quot;, err.Error())
    }

    return ret, nil
}

</code></pre>
<p>Here are the big steps :</p>
<ol>
<li>Parse the request content to get the user id</li>
<li>Create a session to perform the transaction</li>
<li>Declare the callback function using the id argument</li>
<li>Call the callback function from a transaction</li>
<li>Get back the <code>*mongo.SingleResult</code> as an <code>interface{}</code> and parsing it back to its original type</li>
<li>Decode the bson document contained in the <code>*mongo.SingleResult</code> to put it in the return struct</li>
</ol>
<p>This function works, but is very verbose. The code is very duplicated.</p>
<p>I wonder if there is a way of not repeating the same code for each function I wanna make. My previous wrapper function attempts didn't  lead to anything, as I actually need the variables where they are now at each call.</p>
<p>Still, the steps 2 and 5 especially seem very redundant and inefficient.</p>
<p>Anyone got any idea ?</p>

